const Home = () =>{
    return (
        <div className = 'home'>
            <h1 style = {{textAlign:'left'}}>HOME PAGE</h1>
            <div className = 'home-top-pics'></div>
            <div className = 'home-about-me'></div>
            <div className = 'home-bottom-pics'></div>
            <div className = 'home-accomplishments'></div>
        </div>
    )
}

export default Home
